import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 0 auto;
`;
const Title = styled.h1`
  color: black;
`;
export default () => {
  //FIXME: API DATA WEBSITE === https://api.nasa.gov/index.html
  const API_KEY: string = "api_key=J9c8DvGBTzcqvhFd8UPQIJqhzJ80Ractk3JBOiRx";
  const baseUrl = "https://api.nasa.gov";
  const test = async () => {
    const response = await fetch(`${baseUrl}/planetary/apod?date=1996-22-08&${API_KEY}`);
    const data = await response.json();
    console.log("datos", data);
  };

  return (
    <div>
      <Container>
        <Title onClick={() => test()}>Api Connected Website</Title>
      </Container>
    </div>
  );
};
